import axios from "axios";

const headers = {
    'Content-Type': 'application/json'
};

export class PersonaService{
    baseUrl="http://localhost:30902/api"
    getAll(){
        return axios.get(this.baseUrl+"/usuario?page=0&size=5&sort=username,asc&search="),{headers}.then(res => res.data)
    }
}
